<style>
:root{
  --bg:#0a0a0a; --text:#fff4d6; --muted:#d7c59a; --border:#3a2a14;
  --gold:#ffcc33; --gold2:#ffe38a; --headerH:72px; --sidebarW:280px;
}
*{box-sizing:border-box} html,body{height:100%}
body{
  margin:0; background:linear-gradient(180deg,#070707,#0a0a0a 45%,#070707);
  color:var(--text); font-family:ui-sans-serif,system-ui,-apple-system,Segoe UI,Roboto,Helvetica,Arial;
  overflow-x:hidden; opacity:0; animation:pageFade .4s ease-out forwards;
}
@keyframes pageFade{ from{opacity:0} to{opacity:1} }

/* Background canvases */
.canvas-layer{ position:fixed; left:0; right:0; pointer-events:none; z-index:0 }
#goldDust{ top:0; height:100vh } #fire{ bottom:0; height:34vh }

/* Header */
@keyframes textPulse{0%,100%{text-shadow:0 0 14px rgba(255,204,51,.8),0 0 40px rgba(255,255,255,.3)}50%{text-shadow:0 0 28px rgba(255,238,170,1),0 0 70px rgba(255,255,255,.6)}}
.header{ position:fixed; top:0; left:0; right:0; height:var(--headerH);
  background:linear-gradient(180deg,rgba(58,45,18,.95),rgba(36,28,12,.92));
  border-bottom:1px solid rgba(255,224,120,.18); box-shadow:inset 0 -1px 0 rgba(255,224,120,.08);
  z-index:999; display:grid; grid-template-columns:280px 1fr 120px; align-items:center;
}
.header-left{ display:flex; align-items:center; gap:12px; padding-left:14px }
.toggle{ width:42px; height:42px; border-radius:12px; border:1px solid rgba(255,224,120,.3);
  background:linear-gradient(180deg,#1a1308,#0f0b07); color:var(--text); display:flex; align-items:center; justify-content:center;
  cursor:pointer; transition:transform .15s ease, box-shadow .2s ease, border-color .2s ease; }
.toggle:hover{ transform:translateY(-1px); border-color:#7a5a22; box-shadow:0 10px 22px rgba(255,204,51,.2), inset 0 0 14px rgba(255,204,51,.08) }
.header-left img.logo{ height:42px; width:auto; filter:drop-shadow(0 0 16px rgba(255,204,51,.6)) }

.header-center{ display:flex; align-items:center; justify-content:center }
.header-center h1{ margin:0; font-size:34px; letter-spacing:3px; text-transform:uppercase;
  background:linear-gradient(180deg,#fff8dc,#ffe38a 40%,#ffcc33 70%,#fff8dc);
  -webkit-background-clip:text; background-clip:text; color:transparent; animation:textPulse 3.5s ease-in-out infinite; }
.header-right{ justify-self:end; padding-right:14px; font-size:12px; color:var(--muted) }

/* Layout */
.app{ display:grid; grid-template-columns:var(--sidebarW) 1fr; min-height:100vh; margin-top:var(--headerH); position:relative; z-index:1; transition:grid-template-columns .35s ease }
body.collapsed .app{ grid-template-columns:0 1fr }

/* Sidebar (slides completely off-screen when collapsed) */
.sidebar-wrap{ position:relative }
.sidebar{ position:fixed; top:var(--headerH); left:0; width:var(--sidebarW); height:calc(100vh - var(--headerH));
  background:linear-gradient(180deg, rgba(30,24,10,.96), rgba(12,10,6,.98)); border-right:1px solid var(--border);
  padding:14px; overflow:auto; transform:translateX(0); opacity:1; transition:transform .35s ease, opacity .25s ease; }
body.collapsed .sidebar{ transform:translateX(-100%); opacity:0; pointer-events:none }

.brand{display:flex;align-items:center;gap:10px;margin-bottom:12px}
.logo-dot{width:26px;height:26px;border-radius:10px;background:linear-gradient(135deg,#ffcc33,#ffe38a);box-shadow:0 0 14px rgba(255,204,51,.45)}
.brand .text{display:flex;flex-direction:column}
.brand strong{background:linear-gradient(180deg,#ffe9a8,#ffcc33);-webkit-background-clip:text;color:transparent}
.muted{color:var(--muted)}

.search{width:100%;padding:10px 12px;border-radius:10px;border:1px solid var(--border);background:#0f0b07;color:var(--text);outline:none;box-shadow:inset 0 0 0 1px rgba(255,236,170,.05)}
.nav{margin-top:10px;display:grid;gap:8px}
.btn{ display:flex;align-items:center;justify-content:space-between;gap:10px; border:1px solid var(--border);
  background:linear-gradient(180deg,#20170a,#100c06); color:var(--text); padding:10px 12px; border-radius:12px; cursor:pointer;
  transition:transform .15s ease, box-shadow .2s ease, border-color .2s ease; }
.btn:hover{ transform:translateY(-1px); border-color:#7a5a22; box-shadow:0 10px 22px rgba(255,204,51,.2), inset 0 0 14px rgba(255,204,51,.08) }
.btn.active{ background:linear-gradient(180deg,#2a1f0c,#151007); box-shadow:inset 0 0 0 1px rgba(255,236,170,.08) }
.key{border:1px solid var(--border);border-radius:6px;padding:2px 6px;font-size:12px;background:#0f0b07;color:#ffe9a8}

.main{position:relative;overflow:hidden}
.topbar{ display:flex;gap:8px;align-items:center;justify-content:space-between;padding:10px 12px;
  border-bottom:1px solid var(--border); background:linear-gradient(180deg, rgba(58,45,18,.55), rgba(36,28,12,.72)); }
.actions{display:flex;gap:8px;flex-wrap:wrap;align-items:center}
.iframe-wrap{position:relative;height:calc(100vh - calc(var(--headerH) + 56px))overflow:hidden;}
iframe{position:absolute;inset:0;width:100%;height:100%;border:0;opacity:0;transform:translateY(6px);transition:opacity .25s ease,transform .25s ease;background:#0b0b0b;box-shadow:inset 0 0 0 1px rgba(255,236,170,.06)display:block;}
iframe.active{opacity:1;transform:none}
.badge{display:inline-block;padding:2px 8px;border:1px solid var(--border);border-radius:999px;background:#0f0b07;color:#ffefbf;font-size:12px}
.kbd{border:1px solid var(--border);padding:2px 6px;border-radius:6px;background:#0f0b07;font-size:12px;color:#ffe9a8}
.note{font-size:12px;color:var(--muted)}

/* Footer centered under the fire */
.site-footer{ position:fixed; left:0; right:0; bottom:6px; text-align:center; z-index:2; color:#e8d7a0; font-size:12px;
  text-shadow:0 0 8px rgba(255,204,51,.4), 0 0 18px rgba(255,255,255,.25) }

/* Responsive */
@media (max-width:1024px){
  /* Auto collapsed default handled in JS */
}
</style>

<script>
/* -------- Viewer core -------- */
const nav=document.getElementById('nav'),title=document.getElementById('title'),
file=document.getElementById('file'),openBtn=document.getElementById('open'),
reloadBtn=document.getElementById('reload'),q=document.getElementById('q');
const items = [
  ['Instagram','CK44_Instagram_30Day_Planner_GoldIntense.html'],
  ['LinkedIn','CK44_LinkedIn_30Day_Planner_GoldIntense.html'],
  ['Medium','CK44_Medium_Planner_1_GoldIntense.html'],
  ['Reddit','CK44_Reddit_30Day_Planner_GoldIntense.html'],
  ['Threads','CK44_Threads_30Day_Planner_GoldIntense.html'],
  ['TikTok','CK44_TikTok_30Day_Planner_GoldIntense.html'],
  ['X','CK44_X_30Day_Planner_GoldIntense.html'],
  ['YouTube','CK44_YouTube_30Day_Planner_GoldIntense.html']
];
let current=0;
function show(i){ current=i;
  document.querySelectorAll('iframe').forEach((f,idx)=>f.classList.toggle('active',idx===i));
  document.querySelectorAll('#nav .btn').forEach((b,idx)=>b.classList.toggle('active',idx===i));
  title.textContent=items[i][0]; file.textContent=items[i][1];
}

/* -------- Sidebar toggle -------- */
const toggleBtn=document.getElementById('toggleBtn'); const LS_KEY='ck44_sidebar_collapsed_web';
function applyCollapsed(coll){ document.body.classList.toggle('collapsed', coll); localStorage.setItem(LS_KEY, coll?'1':'0'); }
toggleBtn.addEventListener('click',()=>{ const next=!document.body.classList.contains('collapsed'); applyCollapsed(next); toggleBtn.querySelector('span').textContent = next ? '☰' : '✖'; });
(function init(){ const ls=localStorage.getItem(LS_KEY);
  const auto = window.matchMedia('(max-width: 1024px)').matches;
  const collapsed = ls ? ls==='1' : auto;
  applyCollapsed(collapsed);
  toggleBtn.querySelector('span').textContent = collapsed ? '☰' : '✖';
})();
window.addEventListener('resize',()=>{ if(!localStorage.getItem(LS_KEY)){ applyCollapsed(window.matchMedia('(max-width: 1024px)').matches);
  toggleBtn.querySelector('span').textContent = document.body.classList.contains('collapsed') ? '☰' : '✖'; }});

/* -------- Canvas helpers -------- */
function fitCanvas(c){ const dpr=Math.max(1,Math.min(2,window.devicePixelRatio||1));
  c.width=Math.floor(innerWidth*dpr); c.height=Math.floor(parseInt(getComputedStyle(c).height)*dpr);
  const ctx=c.getContext('2d'); ctx.setTransform(dpr,0,0,dpr,0,0); return ctx;
}

/* Gold Dust */
(function(){ const c=document.getElementById('goldDust'); let ctx=fitCanvas(c), p=[];
  for(let i=0;i<900;i++) p.push({x:Math.random()*innerWidth,y:Math.random()*innerHeight,r:Math.random()*1.5+.5,s:Math.random()*1+.2});
  function draw(){ ctx.clearRect(0,0,innerWidth,innerHeight);
    for(const o of p){ o.y+=o.s; o.x+=Math.sin(o.y*0.02)*0.3; if(o.y>innerHeight){ o.y=-10; o.x=Math.random()*innerWidth; }
      ctx.beginPath(); const g=ctx.createRadialGradient(o.x,o.y,0,o.x,o.y,o.r*3);
      g.addColorStop(0,'rgba(255,238,170,.9)'); g.addColorStop(1,'rgba(255,204,51,0)');
      ctx.fillStyle=g; ctx.arc(o.x,o.y,o.r,0,Math.PI*2); ctx.fill(); }
    requestAnimationFrame(draw); }
  draw(); window.addEventListener('resize',()=>{ ctx=fitCanvas(c); });
})();

/* Fire footer */
(function(){ const c=document.getElementById('fire'); let ctx=fitCanvas(c), t=0;
  function draw(){ const w=innerWidth, h=parseInt(getComputedStyle(c).height); ctx.clearRect(0,0,w,h);
    const bg=ctx.createLinearGradient(0,0,0,h); bg.addColorStop(0,'rgba(255,180,40,.05)'); bg.addColorStop(1,'rgba(0,0,0,0)');
    ctx.fillStyle=bg; ctx.fillRect(0,0,w,h); const cols=160, colW=w/cols;
    for(let i=0;i<cols;i++){ const x=i*colW; const base=.35+.25*Math.sin(i*.18+t*.06)+.2*Math.sin(i*.07-t*.09);
      const flameH=Math.max(16,h*base); const g=ctx.createLinearGradient(0,h-flameH,0,h);
      g.addColorStop(0,'rgba(255,220,120,0)'); g.addColorStop(.4,'rgba(255,180,60,.4)');
      g.addColorStop(.7,'rgba(255,120,20,.6)'); g.addColorStop(1,'rgba(255,60,0,.85)');
      ctx.fillStyle=g; ctx.beginPath(); ctx.moveTo(x,h); ctx.lineTo(x,h-flameH); ctx.lineTo(x+colW,h-flameH); ctx.lineTo(x+colW,h); ctx.closePath(); ctx.fill(); }
    t+=1; requestAnimationFrame(draw); }
  draw(); window.addEventListener('resize',()=>{ ctx=fitCanvas(c); });
})();
</script>
